import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';
import AppComponent from './Components/App/App';

//state
let state = {
    massage: {
        massageArray : ['Hello', 'World'],
        addMassage : () => {
            alert(this.massageArray[0]);
        }
    }
};

ReactDOM.render(<AppComponent stateFromIndex={state.massage} />, document.getElementById('page'));

serviceWorker.unregister();
